import Card from "./UI/Card";
import EmployeeDetails from "./Components/Emplooyees/EmployeesList";
import { useState } from "react";
import './index.css'

function App() {
  const [shownEmpList, setShownEmoList] = useState(false);

  const buttonHandler = (e) => {
    e.preventDefault()
    setShownEmoList(true)
  }
  return (
    <div>
      <Card>
      {!shownEmpList && <button onClick={buttonHandler}>Emplooyee List</button>}
      </Card>
    {shownEmpList && <Card>
      <EmployeeDetails></EmployeeDetails>
    </Card>}
    </div>

  );
}

export default App;
